import{_ as e,o as r,c as t,O as a}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 36-9.1 Exemptions from applicability of this chapter; conflicts in provisions of law.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/36-9.1.md","filePath":"vacode/36-9.1.md"}'),i={name:"vacode/36-9.1.md"},o=a('<h1 id="§-36-9-1-exemptions-from-applicability-of-this-chapter-conflicts-in-provisions-of-law" tabindex="-1">§ 36-9.1 Exemptions from applicability of this chapter; conflicts in provisions of law. <a class="header-anchor" href="#§-36-9-1-exemptions-from-applicability-of-this-chapter-conflicts-in-provisions-of-law" aria-label="Permalink to &quot;§ 36-9.1 Exemptions from applicability of this chapter; conflicts in provisions of law.&quot;">​</a></h1><p>This chapter shall not be applicable to farm structures as defined in § <a href="http://law.lis.virginia.gov/vacode/36-3/" target="_blank" rel="noreferrer">36-3</a> unless they are within the purview of the Uniform Statewide Building Code, as provided in § <a href="http://law.lis.virginia.gov/vacode/36-99/" target="_blank" rel="noreferrer">36-99</a>. Further, the creation of a redevelopment or conservation area, or designation of an individual structure as blighted pursuant to § <a href="http://law.lis.virginia.gov/vacode/36-49.1:1/" target="_blank" rel="noreferrer">36-49.1:1</a>, under the process for determination of spot blight, shall not abrogate the right to farm as protected in Chapter 3 (§ <a href="http://law.lis.virginia.gov/vacode/3.2-300/" target="_blank" rel="noreferrer">3.2-300</a> et seq.) of Title 3.2. If there is a conflict between the provisions of this chapter and § <a href="http://law.lis.virginia.gov/vacode/3.2-302/" target="_blank" rel="noreferrer">3.2-302</a>, the provisions of § <a href="http://law.lis.virginia.gov/vacode/3.2-302/" target="_blank" rel="noreferrer">3.2-302</a> shall control. If there is a conflict between the provisions of this chapter and § <a href="http://law.lis.virginia.gov/vacode/25.1-106/" target="_blank" rel="noreferrer">25.1-106</a>, the provisions of § <a href="http://law.lis.virginia.gov/vacode/25.1-106/" target="_blank" rel="noreferrer">25.1-106</a> shall control. However, nothing herein shall be construed to preclude enforcement of local, state or federal criminal laws with respect to criminal activities occurring on a property where one or more farm structures are located.</p><p>2006, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?061+ful+CHAP0784" target="_blank" rel="noreferrer">784</a>.</p>',3),n=[o];function l(s,c,h,p,f,d){return r(),t("div",null,n)}const _=e(i,[["render",l]]);export{g as __pageData,_ as default};
